Recently I’ve felt like my faith has needed to be recharged. I thought I needed to be exposed to more than my current context. 
So every time God opens a door for me to visit the place where a giant has fallen, I take it (you’ll need humility for that). I admire and respect what God is doing at @4wardcity. The building is AMAZING, but Pastor @travisgreenetv carries the details of the journey (this is where the oil is). He passionately poured his life out for HOURS, and I could see God through his lens of faith. 

@jermoneglenn is walking wisdom. He bleeds good decisions and the right counsel. 

@iamcourtneybeard is the friend that has become a brother. His value is priceless. 

SN: Surround yourself with people who will help your faith dream and not make it a nightmare.

Before you go to sleep, jump up and dance real quick. Here’s your progressive declaration for the week, “GOD CAN, GOD WILL, GOD DID!” 

